#include<iostream>
#include<cmath>

int main() {
	int n, v[100010];
	bool flag = 1;//1なら素数 0なら合成数
	std::cin >> n;
	for (int i = 0; i < n; ++i) {
		std::cin >> v[i];
		flag = 1;
		//double型をint型に代入してるので少し注意
		for (int j = 2; j <= std::sqrt(v[i]); ++j) {
			if (v[i] % j == 0) { 
				flag = 0;
				break;
			}//1個でも割れたら素数ではない
		}
		if (flag)std::cout << "prime number" << std::endl;
		else std::cout << "composite number" << std::endl;
	}
	return 0;
}
